import Vue from 'vue'
import VueRouter from 'vue-router'
import DescriptionEspaces from "../views/DescriptionEspaces";
Vue.use(VueRouter)

const routes = [
  {
    path: '/',
    name: 'home',
    component: DescriptionEspaces
  }
]

const router = new VueRouter({
  routes
})

export default router
